import './App.css';
import React, { Component } from "react";
import Contactinfo from './components/Contactinfo';

class App extends Component {
  constructor() {
    super();

    this.state = {
      firstName: "FirstName",
      lastName: "LastName",
    };



  }
  editValue = (e) => {
    this.setState({
      task: e.target.value,
    });
  };

  render() {
  return (
    <div className="App">
      <Contactinfo firstName={this.state.firstName} lastName={this.state.lastName}></Contactinfo>
    </div>
  );
  }
}

export default App;
